import React from 'react';
import QueEs from '../components/eneagrama/QueEsEneagrama';
import ParaQue from '../components/eneagrama/ParaQueEneagrama';
import TiposEneagrama from '../components/eneagrama/TiposEneagrama';
import CursoBasico from '../components/eneagrama/CursoBasicoEneagrama';
import EneagramaEmpresas from '../components/eneagrama/EneagramaEmpresas';
import OtrasAplicaciones from '../components/eneagrama/OtrasAplicacionesEneagrama';
import '../styles/eneagrama/TiposEneagrama.css';
import '../styles/global/SeccionContainer.css';


const Eneagrama = () => {
    return (
        <div className="eneagrama-page">
            <div id="que-es">
                <QueEs />
            </div>
            <div id="para-que-sirve">
                <ParaQue />
            </div>
            <div id="tipos-eneagrama">
                <TiposEneagrama />
            </div>
            <div id="curso-basico">
                <CursoBasico />
            </div>
            <div id="eneagrama-empresas">
                <EneagramaEmpresas />
            </div>
            <div id='otras-aplicaciones'>
                <OtrasAplicaciones  />
            </div>
        </div>
    );
};

export default Eneagrama;
